import React from "react";
import { BrowserRouter as Router, Switch, Route} from "react-router-dom";
//import { Container, Header, Menu, Icon } from "semantic-ui-react";
//import Speech from "./Components/Speech";
import Auth from "./Components/Auth";
import Register from "./Components/Register";
import RevCode from "./Components/RevCode"
import HomepageLayout from "./Components/HomepageLayout";
import withAuthProtection from "./withAuthProtection";
import firebase from "./FirebaseAPI";
const ProtectedProfile = withAuthProtection("/login")(RevCode);


export class App extends Component {
  constructor() {
    super();
    console.log("user", firebase.currentUser);
    this.state = {
      me: firebase.currentUser
    };
  }
  componentDidMount() {
    firebase.onAuthStateChanged(me => {
      this.setState({ me });
    });
  }
  render() {
    return (
  <div>
    <Router>
      <Switch>
        <Route path="/" exact component={HomepageLayout} />
        <Route path="/login" component={Auth} />
        <Route path="/register" component={Register} />
        <Route path="/main" component={RevCode} />
      </Switch>
    </Router>
  </div>
  )
  }
}


export default App;
